import React from "react";

const SKILLS = ["HTML", "CSS", "JAVASCRIPT"];

const LIBRARY = ["REACT", "DATE-FNS"];

const TOOLS = [
  "JIRA",
  "CONFLUENCE",
  "GIT",
  "GITHUB",
  "VISUAL STUDIO CODE",
  "STORYBOOK",
  "JENKINS",
  "LUCID CHART",
  "ZOOM",
];

const Skills = () => {
  return (
    <div className="skillsContainer">
      <ul>
        <h3>SKILLS</h3>
        {SKILLS.map((skill, index) => (
          <li key={index}>{skill}</li>
        ))}
      </ul>
    </div>
  );
};

export default Skills;
